const $ = require("jquery");
const Chessground = require('chessground').Chessground;
const Chess = require('chess.js').Chess;
const chess = new Chess();
function getStartPositionFen() {
    let fen = null;
    $.ajax({
        async: false,
        type: 'GET',
        url: "/get_start",
        success: function (data) {
            fen = data;
        }
    });
    return fen;
}
function getMoves() {
    let moves = [];
    $.ajax({
        async: false,
        type: 'GET',
        url: "/get_moves",
        success: function (data) {
            moves = JSON.parse(data);
        }
    });
    return moves;
}
function toDests() {
    const dest = {};
    getMoves().forEach(m => {
        dest[m[0]] = [m[1]];
    });
    return dest;
}
function toColor(chess) {
    return (chess.turn() === 'w') ? 'white' : 'black';
}
function registerMove(move) {
    console.log('registerd move: ' + move);
    $.get("/play/" + move);
}
function playOtherSide(board, chess) {
    return (orig, dest) => {
        chess.move({ from: orig, to: dest });
        board.set({
            turnColor: toColor(chess),
            movable: {
                color: toColor(chess),
                dests: toDests()
            }
        });
    };
}
const config = {
    fen: getStartPositionFen(),
    movable: {
        color: 'white',
        free: false,
        dests: toDests(),
    },
    draggable: {
        showGhost: true
    }
};
const board = Chessground(document.getElementById('chessboard'), config);
window['board'] = board;
board.set({
    movable: { events: { after: playOtherSide(board, chess) } }
});

